import React, { useState } from "react";
const New = () => {
  const [materials, setMaterials] = useState([
    {
      label: "Cotton",
      value: "cotton",
    },
    {
      label: "Leather",
      value: "leather",
    },
    {
      label: "Banana",
      value: "banana",
    },
    {
      label: "Pineapple",
      value: "pineapple",
    },
  ]);
  return (
    <div>
      <select>
        {materials.map((mat) => (
          <option
            value={mat.value}
            onChange={(e) => setMaterials(e.target.value)}
          >
            {mat.label}
          </option>
        ))}
      </select>
    </div>
  );
};
export default New;
